import React, { useState } from 'react';
import { Upload, FileText, Server, Package } from 'lucide-react';
import axios from 'axios';

const FileUpload = ({ onGraphData, onLoading, onError }) => {
  const [selectedType, setSelectedType] = useState('terraform');

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    onLoading(true);
    onError(null);

    try {
      const formData = new FormData();
      // Fix: Change 'file' to 'files' to match backend expectation
      formData.append('files', file);

      // Add required fields based on the selected type
      if (selectedType === 'terraform') {
        formData.append('type', 'terraform'); // or whatever type your backend expects
      } else if (selectedType === 'helm') {
        formData.append('chart', file.name); // or use a default chart name
      }

      let endpoint;
      switch (selectedType) {
        case 'terraform':
          endpoint = '/api/parse/terraform';
          break;
        case 'kubernetes':
          endpoint = '/api/parse/kubernetes';
          break;
        case 'helm':
          endpoint = '/api/parse/helm';
          break;
        default:
          throw new Error('Invalid file type');
      }

      const response = await axios.post(endpoint, formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      onGraphData(response.data);
    } catch (err) {
      // Improved error handling to prevent React rendering errors
      let errorMessage = 'Failed to process file';

      if (err.response?.data) {
        if (typeof err.response.data === 'string') {
          errorMessage = err.response.data;
        } else if (err.response.data.detail) {
          // Handle FastAPI/Pydantic validation errors
          if (typeof err.response.data.detail === 'string') {
            errorMessage = err.response.data.detail;
          } else if (Array.isArray(err.response.data.detail)) {
            // Handle validation errors array
            errorMessage = err.response.data.detail
              .map(error => `${error.loc?.join('.')}: ${error.msg}`)
              .join('; ');
          } else {
            // Fallback for other detail formats
            errorMessage = JSON.stringify(err.response.data.detail);
          }
        } else if (err.response.data.message) {
          errorMessage = err.response.data.message;
        } else {
          // Fallback for any other object format
          errorMessage = `Server error: ${JSON.stringify(err.response.data)}`;
        }
      } else if (err.message) {
        errorMessage = err.message;
      }

      onError(errorMessage);
    } finally {
      onLoading(false);
    }
  };

  return (
    <div className="file-upload">
      <h2>
        <Upload size={24} />
        Upload Infrastructure Code
      </h2>

      <div className="upload-options">
        <label className={`option ${selectedType === 'terraform' ? 'active' : ''}`}>
          <input
            type="radio"
            name="fileType"
            value="terraform"
            checked={selectedType === 'terraform'}
            onChange={(e) => setSelectedType(e.target.value)}
          />
          <FileText size={20} />
          Terraform Plan
        </label>

        <label className={`option ${selectedType === 'kubernetes' ? 'active' : ''}`}>
          <input
            type="radio"
            name="fileType"
            value="kubernetes"
            checked={selectedType === 'kubernetes'}
            onChange={(e) => setSelectedType(e.target.value)}
          />
          <Server size={20} />
          Kubernetes YAML
        </label>

        <label className={`option ${selectedType === 'helm' ? 'active' : ''}`}>
          <input
            type="radio"
            name="fileType"
            value="helm"
            checked={selectedType === 'helm'}
            onChange={(e) => setSelectedType(e.target.value)}
          />
          <Package size={20} />
          Helm Chart
        </label>
      </div>

      <div className="upload-area">
        <input
          type="file"
          id="file-upload"
          onChange={handleFileUpload}
          accept={selectedType === 'terraform' ? '.json' : selectedType === 'kubernetes' ? '.yaml,.yml' : '.tgz,.tar.gz'}
          style={{ display: 'none' }}
        />
        <label htmlFor="file-upload" className="upload-button">
          <Upload size={20} />
          Choose {selectedType} file
        </label>

        <div className="file-info">
          {selectedType === 'terraform' && 'Upload terraform plan JSON file'}
          {selectedType === 'kubernetes' && 'Upload Kubernetes YAML manifest(s)'}
          {selectedType === 'helm' && 'Upload Helm chart (.tgz) or values.yaml'}
        </div>
      </div>
    </div>
  );
};

export default FileUpload;
